function EmButton() {
  return (
    <button className='btn'>
      Emergency
    </button>
  );
}
function LogButton(){
    return (<button className='mtl'>
        Log In
    </button>
    );
}

export default function MyApp() {
  return (
    <div className='all'>

      <EmButton />
    </div>
  );
}
